  `talker_id` bigint NULL DEFAULT NULL COMMENT '聊天对象id \n每当用户发送一条信息，都会写入一次数据库，其中is_send为1表示自己发的，然后同时给被接受者反向写入id但是send值为0，表示被接收。\n第二，当用户删除自己的聊天框时，使用delete把该用户id和对象的id全部满足的记录删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

