DROP TABLE IF EXISTS `product`;
CREATE TABLE `product`  (
  `id` bigint NOT NULL,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '未命名',
  `price` decimal(16, 2) NOT NULL DEFAULT 0.00,
  `main_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `content` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '未添加描述',
  `brand` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '会有一个品牌表',
  `category` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '0' COMMENT '会有一个分类表',
  `stock` int NOT NULL DEFAULT 0 COMMENT '当库存为0时则无法购买',
  `flag` int NOT NULL DEFAULT 0 COMMENT '判断是否为真',
  `created` timestamp NULL DEFAULT NULL COMMENT '时间戳在创建新商品时产生',
  `properties1` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '无' COMMENT '如手机：颜色，衣服：颜色。。。以空格隔开',
  `properties2` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '无' COMMENT '如手机规格：8+128gb，衣服 S,M,L,XL,XXL 以空格隔开。若无第二规格，则在第一个开头显示 无',
  `courier_fees` decimal(16, 2) NULL DEFAULT 0.00 COMMENT '快递费',
  `merchant` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '属于哪一个商家',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

